import React from 'react'
import Emoji from './Emoji'

const Entry = (props) => {

  return (
    <div className="term">
          <dt>
            <Emoji emoji={props.emoji}/>
            <span>{props.name}</span>
          </dt>
          <dd>
            {props.meaning}
          </dd>
        </div>
  )
}

export default Entry
